      <!-- ko text: element[attribute] --><!-- /ko --><br/>\n            <!-- /ko -->\n         <!-- /ko -->\n    <!-- /ko -->\n    <!-- ko if: (address().isEditable()) -->\n    <button type=\"button\"\n            class=\"action edit-address-link\"\n            data-bind=\"click: editAddress, visible: address().isEditable()\">\n        <span data-bind=\"i18n: 'Edit'\"></span>\n    </button>\n    <!-- /ko -->\n    <button type=\"button\" data-bind=\"click: selectAddress\" class=\"action action-select-shipping-item\">\n        <span data-bind=\"i18n: 'Ship Here'\"></span>\n    </button>\n</div>\n","Magento_Checkout/template/billing-address/list.html":"<!--\n/**\n * Copyright \u00c2\u00a9 2013-2017 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n<div class=\"field field-select-billing\">\n    <label class=\"label\"><span data-bind=\"i18n: 'My billing and shipping address are the same'\"></span></label>\n    <div class=\"control\" data-bind=\"if: (addressOptions.length > 1)\">\n        <select class=\"select\" name=\"billing_address_id\" data-bind=\"\n        options: addressOptions,\n        optionsText: addressOptionsText,\n        value: selectedAddress,\n        event: {change: onAddressChange(selectedAddress())};\n    \"></select>\n    </div>\n</div>\n","Magento_Checkout/template/billing-address/details.html":"<!--\n/**\n * Copyright \u00c2\u00a9 2013-2017 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n<div class=\"billing-address-details\" data-bind=\"if: isAddressDetailsVisible() && currentBillingAddress()\">\n    <!-- ko text: currentBillingAddress().prefix --><!-- /ko --> <!-- ko text: currentBillingAddress().firstname --><!-- /ko -->\n    <!-- ko text: currentBillingAddress().lastname --><!-- /ko --> <!-- ko text: currentBillingAddress().suffix --><!-- /ko --><br/>\n    <!-- ko text: currentBillingAddress().street --><!-- /ko --><br/>\n    <!-- ko text: currentBillingAddress().city --><!-- /ko -->, <!-- ko text: currentBillingAddress().region --><!-- /ko --> <!-- ko text: currentBillingAddress().postcode --><!-- /ko --><br/>\n    <!-- ko text: getCountryName(currentBillingAddress().countryId) --><!-- /ko --><br/>\n    <!-- ko text: currentBillingAddress().telephone --><!-- /ko --><br/>\n    <!-- ko foreach: { data: currentBillingAddress().customAttributes, as: 'element' } -->\n        <!-- ko foreach: { data: Object.keys(element), as: 'attribute' } -->\n            <!-- ko if: element[attribute].value != null -->\n                <!-- ko text: element[attribute].value --><!-- /ko -->\n            <!-- /ko -->\n            <!-- ko if: element[attribute].value == null -->\n                <!-- ko text: element[attribute] --><!-- /ko -->\n            <!-- /ko -->\n        <!-- /ko -->\n    <!-- /ko -->\n    <button type=\"button\"\n            class=\"action action-edit-address\"\n            data-bind=\"visible: !isAddressSameAsShipping(), click: editAddress\">\n        <span data-bind=\"i18n: 'Edit'\"></span>\n    </button>\n</div>\n","Magento_Checkout/template/billing-address/form.html":"<!--\n/**\n * Copyright \u00c2\u00a9 2013-2017 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n<div class=\"billing-address-form\" data-bind=\"fadeVisible: isAddressFormVisible\">\n    <!-- ko foreach: getRegion('before-fields') -->\n    <!-- ko template: getTemplate() --><!-- /ko -->\n    <!--/ko-->\n    <form data-hasrequired=\"* Required Fields\">\n        <fieldset id=\"billing-new-address-form\" class=\"fieldset address\">\n            <!-- ko foreach: getRegion('additional-fieldsets') -->\n            <!-- ko template: getTemplate() --><!-- /ko -->\n            <!--/ko-->\n            <!-- ko if: (isCustomerLoggedIn && customerHasAddresses) -->\n            <div class=\"choice field\">\n                <input type=\"checkbox\" class=\"checkbox\" id=\"billing-save-in-address-book\" data-bind=\"checked: saveInAddressBook\" />\n                <label class=\"label\" for=\"billing-save-in-address-book\">\n                    <span data-bind=\"i18n: 'Save in address book'\"></span>\n                </label>\n            </div>\n            <!-- /ko -->\n        </fieldset>\n    </form>\n</div>\n","Magento_Checkout/template/payment-methods/list.html":"<!--\n/**\n * Copyright \u00c2\u00a9 2013-2017 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n -->\n<div if=\"isPaymentMethodsAvailable()\"\n     class=\"items payment-methods\">\n    <div repeat=\"foreach: paymentGroupsList, item: '$group'\"\n         class=\"payment-group\">\n        <div if=\"getRegion($group().displayArea)().length\"\n             translate=\"getGroupTitle($group)\"\n             class=\"step-title\"\n             data-role=\"title\">\n        </div>\n        <each args=\"data: getRegion($group().displayArea), as: 'method'\" render=\"\"/>\n    </div>\n</div>\n<div ifnot=\"isPaymentMethodsAvailable()\"\n     class=\"no-payments-block\"\n     translate=\"'No Payment Methods'\">\n</div>\n","Magento_Checkout/template/cart/shipping-estimation.html":"<!--\n/**\n * Copyright \u00c2\u00a9 2013-2017 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n<form method=\"post\" id=\"shipping-zip-form\">\n    <fieldset class=\"fieldset estimate\">\n        <legend class=\"legend\">\n            <span data-bind=\"text: isVirtual ? $t('Estimate Tax') : $t('Estimate Shipping and Tax') \"></span>\n        </legend><br>\n        <p class=\"field note\" data-bind=\"text: isVirtual ? $t('Enter your billing address to get a tax estimate.') : $t('Enter your destination to get a shipping estimate.')\"></p>\n        <!-- ko foreach: getRegion('address-fieldsets') -->\n        <!-- ko template: getTemplate() --><!-- /ko -->\n        <!--/ko-->\n    </fieldset>\n</form>\n","Magento_Checkout/template/cart/totals.html":"<!--\n/**\n * Copyright \u00c2\u00a9 2013-2017 Magento, 